import React from 'react';
import dogsdata from '../dogsdata';
import { Card, CardBody, CardTitle, CardSubtitle } from 'reactstrap';


const Details  = ({match}) => {
    const {id} = match.params;

    const myDog = dogsdata.find(dog => dog.id === id);
    console.log(id);
    const {name , age, breed} = myDog

    return(
        <div>
            <Card className="cardClass">
            {/* <CardImg top width="100%" src="/assets/318x180.svg" alt="Card image" /> */}
                <CardBody>
                   <CardTitle><h1>Köpeğin Adı: {name}</h1></CardTitle>
                   <CardSubtitle><h3>Köpeğin Cinsi:{breed} </h3></CardSubtitle>
                   <CardSubtitle><h3>Köpeğin Yaşı:{age} </h3></CardSubtitle>
                </CardBody>
    
            </Card>
        </div>
    )
}


 export default Details;
